// 1.第一步引入vue文件  ==》因为是构造函数  名字需要大写
import Vue from 'vue'
// 4.引入
import App from './App.vue'

// 2.引入完毕之后  创建vue实例化对象
const vw = new Vue({
  render:(h)=>h(App)
})

// 3.给vue实例化对象挂载一个容器  需在html上准备好  （获取容器的id名或者类名）
vw.$mount('#app')
